import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './StyleEditor.module.css';

const toolbarItems = [
  { id: 1, icon: '📷', label: 'Camera' },
  { id: 2, icon: '🎨', label: 'Style' },
  { id: 3, icon: '📏', label: 'Grid' },
  { id: 4, icon: '📐', label: 'Layout' },
  { id: 5, icon: '💰', label: 'Price' },
  { id: 6, icon: '❌', label: 'Remove' }
];

const categories = [
  'Basic jumpers',
  'Warm puffer',
  'Bomber',
  'Biker jacket'
];

const bottomTools = [
  { icon: '👔', label: 'Collar' },
  { icon: '👕', label: 'Styles' },
  { icon: '👖', label: 'Pant' },
  { icon: '🧥', label: 'Coat' },
  { icon: '👜', label: 'Accessories' },
  { icon: '🔧', label: 'Tools' }
];

export default function StyleEditor() {
  const navigate = useNavigate();
  const [isFavorite, setIsFavorite] = useState(false);
  const [selectedProfile, setSelectedProfile] = useState(0);
  const [selectedCategory, setSelectedCategory] = useState(0);

  const handleClose = () => {
    navigate(-1);
  };

  const toggleFavorite = () => {
    setIsFavorite(!isFavorite);
  };

  return (
    <div className={styles.container}>
      {/* Status Bar */}
      <div className={styles.statusBar}>
        <span>12:30</span>
        <div className={styles.statusIcons}>
          <span>📶</span>
          <span>🔋</span>
        </div>
      </div>

      {/* Header */}
      <div className={styles.header}>
        <button className={styles.closeButton} onClick={handleClose}>✕</button>
        <div className={styles.sparkle}>✨</div>
        <div className={styles.headerRight}>
          <button className={styles.iconButton}>🛒</button>
          <button className={styles.iconButton} onClick={toggleFavorite}>
            {isFavorite ? '❤️' : '🤍'}
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className={styles.mainContent}>
        <div className={styles.imageContainer}>
          <img 
            src="/assets1/man.png"
            alt="Style preview"
            className={styles.mainImage}
          />
        </div>

        {/* Right Toolbar */}
        <div className={styles.rightToolbar}>
          <div className={styles.toolsLabel}>Tools</div>
          <button className={styles.toolButton}>📷</button>
          <button className={styles.toolButton}>🎨</button>
          <button className={styles.toolButton}>📏</button>
          <button className={styles.toolButton}>📐</button>
          <button className={styles.toolButton}>💰</button>
          <button className={styles.toolButton}>❌</button>
        </div>

        {/* Profile Circles */}
        <div className={styles.profilesContainer}>
          <button className={`${styles.profileButton} ${styles.selectedProfile}`}>
            <img src="/assets1/man.png" alt="Profile 1" />
          </button>
          <button className={styles.profileButton}>
            <img src="/assets1/Frame 1597881673.png" alt="Profile 2" />
          </button>
          <button className={styles.profileButton}>
            <img src="/assets1/Frame 1597881674.png" alt="Profile 3" />
          </button>
          <button className={styles.profileButton}>
            <img src="/assets1/Frame 1597881674 (1).png" alt="Profile 4" />
          </button>
          <button className={styles.profileButton}>
            <img src="/assets1/polo-style.png" alt="Profile 5" />
          </button>
        </div>

        {/* Categories */}
        <div className={styles.categoriesContainer}>
          {categories.map((category, index) => (
            <button
              key={index}
              className={`${styles.categoryButton} ${selectedCategory === index ? styles.selectedCategory : ''}`}
              onClick={() => setSelectedCategory(index)}
            >
              {category}
            </button>
          ))}
          <button className={styles.searchButton}>🔍</button>
        </div>

        {/* Bottom Navigation */}
        <div className={styles.bottomNav}>
          {bottomTools.map((tool, index) => (
            <button key={index} className={styles.navItem}>
              <span className={styles.navIcon}>{tool.icon}</span>
              <span className={styles.navLabel}>{tool.label}</span>
            </button>
          ))}
        </div>
      </div>
    </div>
  );
}
